Verenigde Staten
Komedie
105 minuten

geregisseerd door Bob Gosse
met Matt Czuchry, Keri Lynn Pratt en Jesse Bradford

Tucker Max (Czuchry) is uitgenodigd voor het vrijgezellenfeestje van zijn vriend. Tucker gaat naar dit feestje en verzint daar een leugen, die zijn vriend in de problemen brengt. Als hij vervolgens wordt geweerd van de bruiloft moet hij op zoek naar een manier om het goed te maken.

